INSERT INTO `games` (`id`, `name`, `description`, `price`, `genres_id`, `date_release`, `developer`, `system_requirements`, `cover`) VALUES ('1', 'WatchDogs', 'В Watch_Dogs вы окажетесь в полномасштабной симуляции города. С помощью смартфона Эйден в реальном времени может управлять городской инфраструктурой. Взломав светофоры, вы сможете загнать своего врага в пробку из 30 машин. Остановите поезд, чтобы забраться внутрь и скрыться от стражей порядка. Ускользните от преследователей, вовремя разведя мост. Все, что подключено к системе ctOS, может стать вашим оружием.', '1237', '1', '2009-07-27 15:51:15', 'Davis LLC', 'Aut officiis ut quis. Quod voluptatibus minima quia. Debitis ullam reprehenderit architecto error perspiciatis fugit molestiae.', '/32c2de577169ba4ff0941a98f7c18a85.jpg');
INSERT INTO `games` (`id`, `name`, `description`, `price`, `genres_id`, `date_release`, `developer`, `system_requirements`, `cover`) VALUES ('2', 'WatchDogs 2', 'В Watch Dogs: Legion — новом эпизоде знаменитой серии игр — вам предстоит создать сопротивление, выбирая сторонников среди всех жителей Лондона, и вернуть город к нормальной жизни!', '1518', '2', '1973-03-24 21:13:12', 'Wolff, Littel and Leannon', 'Commodi ut voluptas excepturi nostrum voluptates dolor ipsam earum. Quas et et ipsa ut iste perferendis autem. Natus nam assumenda quos enim.', '/a2ae11751968955b4a101633344fd4d8.jpg');
INSERT INTO `games` (`id`, `name`, `description`, `price`, `genres_id`, `date_release`, `developer`, `system_requirements`, `cover`) VALUES ('3', 'WatchDogs:Legion', 'Повсеместное наблюдение, военные компании на страже порядка, организованная преступность... С нас хватит! Пора прекратить этот беспредел. Вербуйте людей, чтобы создать сопротивление и избавиться от тех, кто захватил власть в когда-то великом городе. Судьба Лондона - в ваших руках.', '2707', '3', '2007-10-25 03:15:28', 'O\'Hara-Ward', 'Impedit expedita occaecati quia nihil nobis ab error. Placeat libero qui dolorem repudiandae id in. Deleniti impedit veniam laudantium at.', '/689e40b8544530ad41e2bc064444e027.jpg');
INSERT INTO `games` (`id`, `name`, `description`, `price`, `genres_id`, `date_release`, `developer`, `system_requirements`, `cover`) VALUES ('4', 'GTA V', 'Действие игры происходит в вымышленном штате Сан-Андреас, прообразом которого послужила Южная Калифорния. Сюжет в однопользовательском режиме строится вокруг приключений троих грабителей, устраивающих всё более дерзкие ограбления и противостоящих как организованной преступности, так и правоохранительным ведомствам.', '2351', '4', '1997-06-16 23:03:46', 'Fadel, Nader and Jaskolski', 'Vel repellendus nisi saepe nostrum. Atque hic aut consectetur placeat ad dolor.', '/c8cdcd052d26ef947bce08630bbca35c.jpg');
